import React from 'react';
import { useNav } from '../customHooks/useNav';
import './Page.css';

const Home = () => {
	// useNav takes in a navLinkId and returns a ref
	// this ref is used to register the navLinkId that's
	// currently in view, and apply activeClass styling
	// to the corresponding nav childElement

	const homeRef = useNav('Home');

	return (
		<section ref={homeRef} id='homeContainer'>
			<img
				src='https://source.unsplash.com/random/600x600/?food,protein'
				alt='unsplash-img'
			/>
			<div>
				<h3>Smart Proteins</h3>
				<p>Protein is crucial for your baby's growth throughout pregnancy. Do you know how much protein you need per day as a pregnant woman? This website aims to help pregnant women choose good sources of protein.</p>
			</div>
		</section>
	);
};

export default Home;
